function Menu(){
    return (
    <p>
    Menu:
    <ul>
    <li><a href="/profile">Profile</a></li>
    <li><a href="/proyek">Proyek</a>
    <ul>
    <li><a href="/proyek/web-app">Web App</a></li>
    <li><a href="/proyek/mobile-app">Mobile App</a></li>
    </ul>
    </li>
    </ul>
    </p>
    );
   }
   export default function WebApp(){
    return (
    <div>
    <h1>Web App</h1>
    <p>Web App atau dalam bahasa Indonesia disebut sebagai aplikasi be
   rbasis web merupakan aplikasi yang dijalankan pada web browser</p>
    <hr />
    <Menu />
    </div>
    )
   }
